    getConfigFile() {
      this.loading = true;
      this.getConfigFileSubscribe = this.api.getConfigFile(this.orgId, 'Configuration File').subscribe(res => {
        if (res) {
          let selectedOper = [];
          if (this.workflowInputData.actions) {
            this.workflowInputData.actions.forEach(element => {
              selectedOper.push(element.fileId);
            });
          }
          let optData = {};
          for (var i = 0; i < res.length; i++) {
            optData[res[i]._id] = res[i];
          }
          for (var j = 0; j < res.length; j++) {
            if (selectedOper.indexOf(res[j]._id) != -1) {
              delete optData[res[j]._id];
            }
          }
          this.cofigFileData = Object.values(optData);
          this.setTableOptions();
          if (this.isRerender) {
            this.rerender();
            this.isRerender = false;
          } else {
            this.dtTrigger.next();
          }
        }
      }, err => {
        this.setTableOptions();
        if (this.isRerender) {
          this.rerender();
          this.isRerender = false;
        } else {
          this.dtTrigger.next();
        }
        this.loading = false;
        this.pageErrorHandle(err);
        this.commonOrgService.pageScrollTop();
      }, () => {
        this.loading = false;
      });
    }
